export default {
  data: function data() {
    return {
      show: false
    };
  },
  computed: {
    stageInfo: function stageInfo() {
      return this.$store.getters.getStageInfo(this.$route.name);
    },
    menuTabs: function menuTabs() {
      if (this.stageInfo.length < 2) {
        return [];
      }

      var father = this.stageInfo[this.stageInfo.length - 2];

      if (father.type === 'tab') {
        var menus = [];
        father.children.forEach(function (item) {
          if (item.inNav) {
            menus.push({
              icon: item.icon || '',
              title: item.title,
              path: item.route
            });
          }
        });
        return menus;
      }

      return [];
    }
  }
};
